import Dashboard from ".././assets/sidebar/Dashboard.svg";
import Discount from ".././assets/sidebar/Discount.svg";
import Home from ".././assets/sidebar/Home.svg";
import LogOut from ".././assets/sidebar/Log Out.svg";
import Message from ".././assets/sidebar/Message.svg";
import Notification from ".././assets/sidebar/Notification.svg";
import Settings from ".././assets/sidebar/Settings.svg";

class Item {
  constructor(id, icon, link, active) {
    this.id = id;
    this.icon = icon;
    this.link = link;
    this.active = active;
    this.style = this.active
      ? { background: "#252836" }
      : { background: "#1e1d2a" };
    this.wrapperStyle = this.active
      ? {
          background: "#EA7C69",
          boxShadow: "0px 8px 24px rgba(234, 124, 105, 0.32)",
        }
      : { background: "#1e1d2a", boxShadow: "0px 8px 24px #1e1d2a" };

    this.iconStyle = this.active
      ? {
          color: "#fff",
          width: "50px",
          height: "18px",
        }
      : { color: "#EA7C69", width: "50px", height: "18px" };
  }
}

export const sidebarItems = {
  data: [
    new Item(1, "fa fa-home", "/", true),
    new Item(2, "fa fa-gg-circle", "/discount", false),
    new Item(3, "fa fa-tachometer", "/dashboard", false),
    new Item(4, "fa fa-bell-o", "/notification", false),
    new Item(5, "fa fa-envelope-o", "/message", false),
    new Item(6, "fa fa-cog", "/settings", false),
    new Item(7, "fa fa-sign-out", "/logout", false),
  ],
};
